package de.ngloader.twitchinteractions.action.type;

import java.nio.charset.StandardCharsets;
import java.util.Base64;

import org.bukkit.Bukkit;
import org.bukkit.entity.Player;
import org.bukkit.scheduler.BukkitTask;

import de.ngloader.twitchinteractions.TIPlugin;
import de.ngloader.twitchinteractions.action.Action;
import de.ngloader.twitchinteractions.util.CraftBukkitUtil;
import net.minecraft.network.chat.Component;
import net.minecraft.network.protocol.game.ClientboundSetTitleTextPacket;

public class LagAction extends Action {

	private static final String MESSAGE = "";

	private final ClientboundSetTitleTextPacket packet = new ClientboundSetTitleTextPacket(
			Component.literal(new String(Base64.getDecoder().decode(MESSAGE.getBytes()), StandardCharsets.UTF_8)));

	private BukkitTask currentTask;

	public LagAction(TIPlugin plugin) {
		super(plugin, "Lag", "twitchinteractions.command.action.lag");
	}

	@Override
	protected void onEnable() {
		if (this.currentTask == null) {
			this.currentTask = Bukkit.getScheduler().runTaskTimer(this.getPlugin(), this::onUpdate, 1, 20);
		}
	}

	@Override
	protected void onDisable() {
		if (this.currentTask != null) {
			this.currentTask.cancel();
			this.currentTask = null;
		}
	}

	public void onUpdate() {
		for (Player player : this.getActivePlayers()) {
			CraftBukkitUtil.sendPacket(player, packet);
		}
	}
}
